DROP TABLE IF EXISTS `xds_task_feedback`;
CREATE TABLE `xds_task_feedback` (
  `id` char(36) NOT NULL DEFAULT '',
  `task_id` char(36) NOT NULL DEFAULT '0' COMMENT '所属任务ID',
